uint32_t clrrowi = 7200;
uint32_t startgamei = 9000;
uint32_t endgamei = 7200;
uint32_t sound;

extern uint32_t clrrowf;
extern uint32_t startgf;
extern uint32_t endgf;

void SysTick_IntArm(uint32_t period, uint32_t priority){
    SysTick->CTRL = 0;
    SysTick->LOAD = period-1;
    SysTick->VAL = 0;
    SCB->SHP[1] = SCB->SHP[1]&(~0xC0000000) | priority<<30;
    SysTick->CTRL = 0x0007;
}
// initialize a 11kHz SysTick, however no sound should be started
// initialize any global variables
// Initialize the 5 bit DAC
void Sound_Init(void){
    SysTick_IntArm(1,0);
    DAC5_Init();
}

void Sound_Start(uint32_t period){
    // write this
      // set reload value
    //systik-->load = period
        //systick-->val = 0x0
    SysTick->LOAD = period-1;
    SysTick->VAL = 0x0;
      // write any value to VAL, cause reload

}


void SysTick_Handler(void){ // called at 11 kHz
  // output one value to DAC if a sound is active
    if(clrrowf){
        Sound_ClrR();
    }
    if(endgf){
        Sound_EndG();
    }
    if(startgf){
        Sound_StartG();
    }
}
//******* Sound_Start ************
// This function does not output to the DAC. 
// Rather, it sets a pointer and counter, and then enables the SysTick interrupt.
// It starts the sound, and the SysTick ISR does the output
// feel free to change the parameters
// Sound should play once and stop
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement


void Sound_StartG(void){
    static uint32_t counts = 0;
    if(counts<startgamei){
        DAC5_Out(startgame[counts]);
        counts++;
    }
    else{
        counts = 0;
        SysTick->LOAD = 0;
        startgf = 0;
    }
}

void Sound_EndG(void){
    static uint32_t counte = 0;
    if(counte<endgamei){
        DAC5_Out(endgame[counte]);
        counte++;
    }
    else{
        counte = 0;
        SysTick->LOAD = 0;
        endgf = 0;
    }
}

void Sound_ClrR(void){
    static uint32_t countc = 0;
    if(countc<clrrowi){
        DAC5_Out(clrrow[countc]);
        countc++;
    }
    else{
        countc = 0;
        SysTick->LOAD = 0;
        clrrowf = 0;
    }
}

